        width:1400px;
        gap:10%;
        margin-top:1%;

}
.link
{
        color:white;
        text-transform:capitalize;
        margin:2%;
        left-margin:14%;
        white-space:no-wrap;
        width:105%;
}
@media screen and (max-width:800px) 
{
        .footer-nav
        {
                display:grid;
                width:100%;
                heigth:100%;
                text-align:center;
                left-margin:40%;
        }
}
`
